import React, { useState, useEffect } from 'react';
import logo from './bd_logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <title className="App-welcome">
          Welcome to Breakdown!
        </title>
      </header>
    </div>
  );
}

export default App;
